import SubscribeImage from "../assets/subscribe.jpg";

const Subscribe = () => {
  return (
    <section className="py-16">
      <img src={SubscribeImage} alt="Subscribe" />
      <form className="mx-auto max-w-[600px] padding-x pt-8 grid gap-5">
        <h1 className="title">Subscribe</h1>
        <p>By subscribing, you will receive Tesla marketing communications.</p>
        <div className="">
          <label className="label" htmlFor="">
            Email
          </label>
          <input className="field" type="text" />
        </div>
        <div>
          <button type="submit" className="button button-sky">
            Submit
          </button>
        </div>
      </form>
    </section>
  );
};

export default Subscribe;
